import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Importa React Router
import Navbar from './Navbar/Navbar';
import Footer from './Footer/Footer';
import Body from './Body/Body';
import Carrusel from './Carrusel/Carrusel';
import FormLogin from './FormLogin/FormLogin'; // Asegúrate de importar tu componente de login
import 'bootstrap/dist/css/bootstrap.min.css';

const App = () => {
  return (
    <Router> {/* Envolvemos la aplicación con Router */}
      <div>
        <Navbar />
        <Routes>
          <Route path="/" element={<Body />} /> {/* Ruta para la página principal */}
          <Route path="/ingresar" element={<FormLogin />} /> {/* Ruta para el formulario de login */}
        </Routes>
        <Footer />
      </div>
    </Router>
  );
};

export default App;
